### Get the best model for specific dataset (Used for ALgros baseline)
def Get_Best_Model_Train_Inference_Time(data_name, win_res_dir_name, data_type):
    
    arr_models = os.listdir(win_res_dir_name + '/' + data_name)
    
    all_models_list = os.listdir(win_res_dir_name + '/' + data_name) 
    
     
    results_vec_train = []
    results_vec_inference = []
    results_vec_mse = []
    for model_name in all_models_list:
        df = pd.read_csv(win_res_dir_name + '/' + data_name+'/'+ model_name, error_bad_lines=False, header  = None)
        results_vec_train.append(df.iloc[3,-1])
        results_vec_inference.append(df.iloc[4,-1])
        results_vec_mse.append(df.iloc[0,-1])
    
    
    best_model_dataset_index_mse = results_vec_mse.index(min(results_vec_mse))
    
    return    results_vec_train[best_model_dataset_index_mse], results_vec_inference[best_model_dataset_index_mse]


def Replace_Nan(res_vec):
    
    ## Replace NAN value with mean values
    col_mean = np.nanmean(res_vec, axis=0)
   
    #Find indices that you need to replace
    print(np.isnan(res_vec))
    if np.any(np.isnan(res_vec) == True):
        inds = np.where(np.isnan(res_vec))
        print(inds)
    
        if len(inds) > 0:
            #Place column means in the indices. Align the arrays using take
            res_vec[inds] = np.take(col_mean, inds[1])
    
    return res_vec

def Average_val(lst):
    return sum(lst) / len(lst)

### Get the best model for specific dataset (Used for No-model Selection baselines)
def Get_baseline_Model_Performances_Dataset(data_name, win_res_dir_name, data_type, baseline_model_name):
    print(data_name)
    arr_models = os.listdir(win_res_dir_name + '/' + data_name)
    
    all_models_list = os.listdir(win_res_dir_name + '/' + data_name) 
    
     
    results_vec_mse = []
    results_vec_mape = []
    results_vec_smape = []
    
    for model_name in all_models_list:
        
        if baseline_model_name in model_name:
            df = pd.read_csv(win_res_dir_name + '/' + data_name+'/'+ model_name, error_bad_lines=False, header  = None)
            results_vec_mse.append(df.iloc[0,-1])
            results_vec_mape.append(df.iloc[1,-1])
            results_vec_smape.append(df.iloc[2,-1]) 
    
    
    results_vec_mse_arr = np.array(results_vec_mse)
    results_vec_mape_arr = np.array(results_vec_mape)
    results_vec_smape_arr = np.array(results_vec_smape)
    
    
    results_vec_mse_arr[np.isinf(results_vec_mse)] = max(results_vec_mse)  ## Replacing infinity values with max vector value
    results_vec_mse_arr[np.isnan(results_vec_mse)] = Average_val(results_vec_mse)  ## Replacing Nan values with with mean vector value
    
    results_vec_mape_arr[np.isinf(results_vec_mape)] = max(results_vec_mape)  ## Replacing infinity values with max vector value
    results_vec_mape_arr[np.isnan(results_vec_mape)] = Average_val(results_vec_mape)  ## Replacing Nan values with with mean vector value
    
    results_vec_smape_arr[np.isinf(results_vec_smape)] = max(results_vec_smape)  ## Replacing infinity values with max vector value
    results_vec_smape_arr[np.isnan(results_vec_smape)] = Average_val(results_vec_smape)  ## Replacing Nan values with with mean vector value
    
    
    
    #results_vec_mse  = Replace_Nan(results_vec_mse)
    #results_vec_mape = Replace_Nan(results_vec_mape)
    #results_vec_smape = Replace_Nan(results_vec_smape)
    
    #best_model_dataset_index_mse = results_vec_mse.index(min(results_vec_mse))
    #best_model_dataset_index_mape = results_vec_mape.index(min(results_vec_mape))
    #best_model_dataset_index_smape = results_vec_smape.index(min(results_vec_smape))
    
    
    return np.nanmean(results_vec_mse_arr), np.nanmean(results_vec_mape_arr), np.nanmean(results_vec_smape_arr) #results_vec_mse[best_model_dataset_index_mse], results_vec_mape[best_model_dataset_index_mape], results_vec_smape[best_model_dataset_index_smape]

   
#### Get Model Files list from a dataset directory
def Get_Model_Files_List(win_res_dir_name, data_type):
    
    dir_datasets_name = os.listdir(win_res_dir_name)   
    for dir_name in dir_datasets_name:
     
           if '.DS_Store' in dir_name:
               continue
           
           if data_type == 'Uni-var':
                all_models_list = os.listdir(win_res_dir_name+'/'+dir_name)
           
           else:
               all_datasets_list = os.listdir(win_res_dir_name+'/'+dir_name) 
           
               for file_name in all_datasets_list:
                  if '.DS_Store' not in file_name:
                      all_models_list = os.listdir(win_res_dir_name+'/'+dir_name+'/'+file_name) 
                      
                         
    return all_models_list 

    
def chunks(l, n):
        n = max(1, n)
        return [l[i:i+n] for i in range(0, len(l), n)]

### Get Difference between two lists
def Diff(li1, li2): 
        return (list(set(li1) - set(li2)))

#### Divide the datasets into 5 folds for training and testing 
def Divide_Dataset_Folds(n_folds, datasets_dir_list):
    
    train_folds_list = []
    test_folds_list = []

    length = int(len(datasets_dir_list)/ n_folds) #length of each fold
    folds = []
    for i in range(n_folds-1):
        folds += [datasets_dir_list[i*length:(i+1)*length]]
    folds += [datasets_dir_list[4*length:len(datasets_dir_list)]]
    
    print(folds)
    
    for fold in folds:        
        train_folds_list.append(Diff(datasets_dir_list, fold))
        test_folds_list.append(fold)


    return train_folds_list, test_folds_list    
        

